import React, { useState } from 'react'
import Input from './Input'

const Login = () => {
  const [inputs,setInputs]=useState()
  const handleSubmit=(e)=>{
    e.preventDefault()
  }
  return (
    <div className='login'>
        <h1>Login</h1>
        <form onSubmit={handleSubmit}>
          <Input
            name="login"
            value={inputs}
          />
        </form>
    </div>
  )
}

export default Login
